import React from 'react';
import Head from 'next/head';

import styled from 'styled-components';

import Auditory from '../components/auditory.js';
import Layout2 from '../components/layout2.js';

import data from '../data/artistList.js';

import '../css/normalize.css';
import '../css/skeleton.css';
import '../css/bootstrap.css';
console.log(data);

const AuditoryPage = () => (
	<Layout2>
		<div>
			{data.map((post, i) => <Auditory {...this.props} key={i} i={i} artist={post} />)}
		</div>
	</Layout2>
);


export default AuditoryPage;
